import Modal from "react-bootstrap/Modal";
import "bootstrap/dist/css/bootstrap.min.css";

export function Login(param){
    return (
      <Modal show={param}>
        <Modal.Body>
          <div className="container d-flex">
           <div className="leftpart"></div>
           <div className="rightpart"></div>
          </div>
        </Modal.Body>
      </Modal>
    );
  };
